                    i.find(j => j.includes(target))
                ))
                .map(i => (
                    `<tr>${i.map(j => (
                        `<td>${j}</td>`
                    )).join("")}</tr>`
                )).join("");
            }

            setDatabase();
        </script>
    </body>
</html>
